de:
Diese 3-Sterne-Residenz liegt nur wenige Minuten von Cabourg und seinem herrlichen Sandstrand entfernt und empfängt Sie das ganze Jahr über. Ob Sie nur auf der Durchreise in der Region sind oder mit der Familie Urlaub machen, die Residenz Kyriad Prestige passt sich Ihren Bedürfnissen an und bietet Ihnen Aufenthalte für eine Nacht, eine Woche oder einen Monat an.

Die Anlage bietet Ihnen allen Komfort, den Sie für einen angenehmen Aufenthalt benötigen, damit Sie sich dort so wohl fühlen wie zu Hause.

Damit Sie sich wie zu Hause fühlen, bietet das Kyriad Prestige Résidence in Dives sur Mer 60 klimatisierte und geschmackvoll eingerichtete Apartments. Die perfekt geschnittenen Apartments verfügen über ein Schlafzimmer mit hochwertiger Bettwäsche, ein Badezimmer mit Handtüchern, eine kleine Küche und sogar Balkone oder Terrassen. Zur Ausstattung gehören ein Safe, ein Flachbildfernseher und kostenloses WLAN

Das Hotel bietet Ihnen, wie immer, ein komplettes Frühstück (kostenpflichtig), das Ihnen nach Belieben serviert wird. Sie werden die große Auswahl an kalten und warmen Getränken sowie die große Auswahl an süßen und herzhaften Produkten zu schätzen wissen, die es beinhaltet.

Um Ihnen während Ihres gesamten Aufenthalts Komfort und Entspannung zu garantieren, bietet Ihnen das Kyriad Prestige :

- Eine Rezeption, die rund um die Uhr und an den Wochenenden 7 Tage die Woche geöffnet ist ;
- Frühstück ;
- Lounge-Bar mit Außenterrasse.
- Badezimmer mit Dusche oder Badewanne ;
- WIFI Kostenlos ;
- Flachbildfernseher ;
- Waschsalon (Waschmaschinen und Wäschetrockner).
WELLNESSBEREICH: Swimmingpool, Hammam, Jacuzzi,
 Preis: 10? für einen Erwachsenen und 5? für ein Kind (bis 10 Jahre)
- Zugang von 10 bis 20 Uhr

ACHTUNG: Aufgrund des von der Regierung angekündigten Energiesparplans ist die Einrichtung gezwungen, das Schwimmbad vom 2. Januar 2023 bis zum 31. März 2023 zu schließen. Der Zugang zum Jacuzzi, zum Hammam und zum Fitnessraum wird jedoch weiterhin angeboten.

it:
Situato a pochi minuti da Cabourg e dalla sua magnifica spiaggia di sabbia, questo residence 3 stelle vi accoglie tutto l'anno. Che siate di passaggio nella regione o in vacanza con la famiglia, il residence Kyriad Prestige si adatta alle vostre esigenze e offre soggiorni a notte, a settimana o al mese.

La struttura offre tutti i comfort necessari per farvi trascorrere un soggiorno piacevole, in modo che vi sentiate a vostro agio come a casa.

Per farvi sentire come a casa, il Kyriad Prestige Residence di Dives sur Mer offre 60 appartamenti, tutti climatizzati e arredati con gusto. Sono perfettamente organizzati e dispongono di una camera da letto con biancheria di qualità, un bagno con asciugamani, una piccola cucina e persino balconi o terrazze. Per quanto riguarda i servizi, troverete una cassaforte, un televisore a schermo piatto e la connessione wifi gratuita

L'hotel offre sempre una colazione completa (a pagamento), servita a volontà. Apprezzerete l'ampia gamma di bevande calde e fredde e la grande varietà di prodotti dolci e salati.

Per garantirvi comfort e relax durante tutto il vostro soggiorno, il Kyriad Prestige offre:

- Una reception aperta 24 ore su 24 e 7 giorni su 7 nei fine settimana;
- Colazione;
- Lounge bar con terrazza esterna.
- Bagno con doccia o vasca;
- WIFI gratuito;
- TV a schermo piatto;
- Lavanderia (lavatrici e asciugatrici).
AREA WELLNESS: Piscina, Hammam, Jacuzzi,
 Prezzo: 10? per un adulto e 5? per un bambino (fino a 10 anni)
- Accesso da 10H a 20H

ATTENZIONE: In seguito al piano di risparmio energetico annunciato dal governo, lo stabilimento è costretto a chiudere la piscina dal 2 gennaio 2023 al 31 marzo 2023. Tuttavia, verrà offerto l'accesso alla Jacuzzi, all'Hammam e alla palestra.

